import React from 'react';
import PropTypes from 'prop-types';

const SBDComponents = ({ data, unit, convertWeight }) => (
  <div className='container'>
    <div className='info'>{data.name}:</div>
    <div className='number'>
        <b>{unit === 'LBS' ? data.currentWeight : convertWeight(data.currentWeight, unit)}</b>
        {unit}
    </div>
    <div className='number'>
        <b>{unit === 'LBS' ? data.goalWeight : convertWeight(data.goalWeight, unit)}</b>
        {unit}
    </div>
  </div>
);

SBDComponents.propTypes = {
  data: PropTypes.shape({
    name: PropTypes.string.isRequired,
    currentWeight: PropTypes.string.isRequired,
    unit: PropTypes.string.isRequired,
  }).isRequired,
  unit: PropTypes.string.isRequired,
  convertWeight: PropTypes.func.isRequired,
};

export default SBDComponents;
